static void* ime_malloc(int size){
    return kmalloc(size,GFP_KERNEL);
}

static void ime_error(const char* msg){
    printk(KERN_ALERT "IME Error: %s\n",msg);
}

static unsigned short readutf8(unsigned char** pptr){
    unsigned int ch0=(*pptr)[0];
    unsigned int ch1=(*pptr)[1];
    unsigned int ch2=(*pptr)[2];
    if(ch0 & 0x80){
        if((ch0 & 0xE0) == 0xC0){
            (*pptr) += 2;
            return ((ch0 & 0x1F) << 6) | (ch1 & 0x3F);
        }else{
            (*pptr) += 3;
            return ((ch0 & 0x0F) << 12) | ((ch1 & 0x3F) << 6) | (ch2 & 0x3F);
        }
    }else{
        (*pptr)++;
        return ch0;
    }
}

static int toutf8(unsigned short unicode,unsigned char* buf){
    if((unicode & 0x7F) == unicode){
        buf[0]=unicode;
        return 1;
    }else{
        if((unicode & 0x7FF) == unicode){
            buf[0]=0xC0 | ((unicode >> 6) & 0x1F);
            buf[1]=0x80 | (unicode & 0x3F);
            return 2;
        }else{
            buf[0]=0xE0 | ((unicode >> 12) & 0x0F);
            buf[1]=0x80 | ((unicode >> 6) & 0x3F);
            buf[2]=0x80 | (unicode & 0x3F);
            return 3;
        }
    }
}

struct Trie{
    int char_cnt;           //终结结点>0
    unsigned short* unicodes;   //NULL则非终结结点
    struct Trie* fa;
    struct Trie* ch[26];
};

static struct Trie* trie_new_node(struct Trie* fa){
    struct Trie* ptr=(struct Trie*)ime_malloc(sizeof(struct Trie));
    if(!ptr){
        ime_error("Cannot alloc trie node");
        return NULL;
    }
    memset(ptr,0,sizeof(struct Trie));
    ptr->fa=fa;
    return ptr;
}

static struct Trie* init_trie(unsigned char* pinyin_ref,unsigned short* chbuf){
    //根据拼音表文件数据构造Trie树 
    struct Trie* root=trie_new_node(NULL);
    struct Trie* ptr;
    int i,j,k;
    int chbuf_ptr=0;
    unsigned char* rptr;
    unsigned short uni;
    int cnt=0;
    if(!root)
        return NULL;
    for(i=0; pinyin_ref[i]; ){
        if(pinyin_ref[i] == '\n')
            return root;
        ptr=root;
        for(j=i; pinyin_ref[j] != ' '; j++){
            if(!ptr->ch[pinyin_ref[j] - 'a'])
                ptr->ch[pinyin_ref[j] - 'a']=trie_new_node(ptr);
            ptr=ptr->ch[pinyin_ref[j] - 'a'];
        }
        j++;
        ptr->unicodes=chbuf + chbuf_ptr;
        rptr=pinyin_ref + j;
        cnt=0;
        while((uni = readutf8(&rptr)) != '\n'){
            chbuf[chbuf_ptr++]=uni;
            cnt++;
        }
        ptr->char_cnt=cnt;
        i=rptr - pinyin_ref;
    }
    return root;
}

